class Solution(object):
    def getNumberOfGroups(self, n, m):
        """
        :type n: int
        :type m: int
        :rtype: int
        """
        if m == 0:
            return 1
        if m == n:
            return 0
        if m == n - 1:
            return 1
        return self.getNumberOfGroups(n - 1, m - 1)
